new_win_rate_1.query:
q = load "opportunity5";
q_A = filter q by (date('CloseDate_Year', 'CloseDate_Month', 'CloseDate_Day') in ["current year".."current day"]) && ('IsWon' == "true");
q_B = filter q by (date('CloseDate_Year', 'CloseDate_Month', 'CloseDate_Day') in ["current year".."current day"]) && ('IsClosed' == "true");
result = group q_A by 'all' full, q_B by 'all';
result = foreach result generate sum(q_A.'Amount') as 'A', sum(q_B.'Amount') as 'B';
result = foreach result generate  'A' / 'B'  as 'C';
result = limit result 2000;

lens_3.query:
q = load "opportunity5";
q = filter q by date('CloseDate_Year', 'CloseDate_Month', 'CloseDate_Day') in ["3 years ago".."current year"];
q = filter q by 'IsWon' == "true";
q = group q by ('CloseDate_Year', 'CloseDate_Month');
q = foreach q generate ('CloseDate_Year' + "~~~") + 'CloseDate_Month' as 'CloseDate_Year~~~CloseDate_Month', avg('Amount') as 'avg_Amount';
q = order q by 'CloseDate_Year~~~CloseDate_Month' asc;
q = limit q 2000;

